namespace RonSijm.FluidHumidifier.Factories.Evidently;

public class LaunchFactory(string resourceName = null, Action<Humidifier.Evidently.Launch> factoryAction = null) : ResourceFactory<Humidifier.Evidently.Launch>(resourceName)
{

    internal List<InnerLaunchLaunchGroupObjectFactory> GroupsFactories { get; set; } = [];

    internal List<InnerLaunchMetricDefinitionObjectFactory> MetricMonitorsFactories { get; set; } = [];

    internal List<InnerLaunchStepConfigFactory> ScheduledSplitsConfigFactories { get; set; } = [];

    internal InnerLaunchExecutionStatusObjectFactory ExecutionStatusFactory { get; set; }

    protected override Humidifier.Evidently.Launch Create()
    {
        var launchResult = CreateLaunch();
        factoryAction?.Invoke(launchResult);

        return launchResult;
    }

    private Humidifier.Evidently.Launch CreateLaunch()
    {
        var launchResult = new Humidifier.Evidently.Launch
        {
            GivenName = InputResourceName,
        };

        return launchResult;
    }
    public override void CreateChildren(Humidifier.Evidently.Launch result)
    {
        base.CreateChildren(result);

        result.Groups = GroupsFactories.Any() ? GroupsFactories.Select(x => x.Build()).ToList() : null;
        result.MetricMonitors = MetricMonitorsFactories.Any() ? MetricMonitorsFactories.Select(x => x.Build()).ToList() : null;
        result.ScheduledSplitsConfig = ScheduledSplitsConfigFactories.Any() ? ScheduledSplitsConfigFactories.Select(x => x.Build()).ToList() : null;
        result.ExecutionStatus ??= ExecutionStatusFactory?.Build();
    }

} // End Of Class

